import React from "react";

function MainTask(props) {
  const { mainTask } = props;
  return (
    <div>
      <div class="main-task">{mainTask.task}</div>
      <div class="btn-big giveup" onclick="javascript:giveUp();">
        give up
      </div>
      <div class="btn-big done" onclick="javascript:mainTaskDone();">
        done!
      </div>
    </div>
  );
}

export default MainTask;
